package ManishLokesh.Neptune.v2.Orders.ResponseBody;public class OrderDeliveryResponse {    private String trainName;    private String trainNo;    private String stationCode;    private String stationName;    private String coach;    private String berth;    private String deliveryDate;    @Override    public String toString() {        return "OrderDeliveryResponse{" +                "trainName='" + trainName + '\'' +                ", trainNo='" + trainNo + '\'' +                ", stationCode='" + stationCode + '\'' +                ", stationName='" + stationName + '\'' +                ", coach='" + coach + '\'' +                ", berth='" + berth + '\'' +                ", deliveryDate='" + deliveryDate + '\'' +                '}';    }    public String getTrainName() {        return trainName;    }    public void setTrainName(String trainName) {        this.trainName = trainName;    }    public String getTrainNo() {        return trainNo;    }    public void setTrainNo(String trainNo) {        this.trainNo = trainNo;    }    public String getStationCode() {        return stationCode;    }    public void setStationCode(String stationCode) {        this.stationCode = stationCode;    }    public String getStationName() {        return stationName;    }    public void setStationName(String stationName) {        this.stationName = stationName;    }    public String getCoach() {        return coach;    }    public void setCoach(String coach) {        this.coach = coach;    }    public String getBerth() {        return berth;    }    public void setBerth(String berth) {        this.berth = berth;    }    public String getDeliveryDate() {        return deliveryDate;    }    public void setDeliveryDate(String deliveryDate) {        this.deliveryDate = deliveryDate;    }}